script: |
  super -f text -I q6034.spq | sort > q6034.out

inputs:
  - name: q6034.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE - col2 + 31 * - 76 NOT BETWEEN + 61 AND ( - col0 * + col0 + col2 * + col0 );
  - name: tab1

outputs:
  - name: q6034.out
    data: |
      51	14	96
      85	5	59
      91	47	68
